function PredictionChart({ data }) {
    return (
      <LineChart width={800} height={400} data={data}>
        <XAxis dataKey="year" />
        <YAxis />
        <Tooltip />
        <CartesianGrid strokeDasharray="3 3" />
        <Line type="monotone" dataKey="predicted" stroke="#82ca9d" />
      </LineChart>
    );
  }
